function ordenamientoBurbuja(arr) {
    const n = arr.length;
    const resultado = [...arr]; // Copia del arreglo
    
    for (let i = 0; i < n - 1; i++) {
        for (let j = 0; j < n - i - 1; j++) {
            if (resultado[j] > resultado[j + 1]) {
                // Intercambiar elementos
                [resultado[j], resultado[j + 1]] = [resultado[j + 1], resultado[j]];
            }
        }
    }
    
    return resultado;
}

// Algoritmo Quick Sort - O(n log n) promedio
function quickSort(arr) {
    if (arr.length <= 1) {
        return arr;
    }
    
    const pivote = arr[Math.floor(arr.length / 2)];
    const menores = [];
    const iguales = [];
    const mayores = [];
    
    for (let elemento of arr) {
        if (elemento < pivote) {
            menores.push(elemento);
        } else if (elemento === pivote) {
            iguales.push(elemento);
        } else {
            mayores.push(elemento);
        }
    }
    
    return [...quickSort(menores), ...iguales, ...quickSort(mayores)];
}

// Algoritmo Merge Sort - O(n log n) garantizado
function mergeSort(arr) {
    if (arr.length <= 1) {
        return arr;
    }
    
    const medio = Math.floor(arr.length / 2);
    const izquierda = arr.slice(0, medio);
    const derecha = arr.slice(medio);
    
    return merge(mergeSort(izquierda), mergeSort(derecha));
}

function merge(izq, der) {
    const resultado = [];
    let i = 0, j = 0;
    
    while (i < izq.length && j < der.length) {
        if (izq[i] <= der[j]) {
            resultado.push(izq[i]);
            i++;
        } else {
            resultado.push(der[j]);
            j++;
        }
    }
    
    return resultado.concat(izq.slice(i)).concat(der.slice(j));
}

